import React from 'react';
import './App.css';
import auto from './images/auto.png';
import shadow1 from './images/Shadow1.png';
import shadow2 from './images/Shadow2.png';
import shadow3 from './images/Shadow3.png';


function Banner() {
    return (
      <div className="banner">
        <Intormation />
        <Image />
      </div>
    );
  }

  export default Banner;

function Intormation() {
  return(
    <div className="banner_div">
      <Container />
    </div>
  )
}

function Image() {
  return(
    <React.Fragment>
      <img src={auto} alt="Audi Q5" className="auto_img" />
      <img src={shadow1} alt="shadow" className="shadow1" />
      <img src={shadow2} alt="shadow" className="shadow2" />
      <img src={shadow3} alt="shadow" className="shadow3" />
      <img src={shadow3} alt="shadow" className="shadow3" />
      <img src={shadow3} alt="shadow" className="shadow3" />
      <img src={shadow3} alt="shadow" className="shadow3" />
    </React.Fragment>

  )
}

function Container() {
  return (
    <div className="container">
      <Model />
      <LeaseDeals/>
      <Description/>
    </div>
  )
}

function Model () {
  return (
    <div>
      <h2>2019 Q5</h2>
      <p>2.OT Quattro Premium</p>
    </div>
  )
}

function LeaseDeals() {
  return (
    <div>
      <LeaseDealItem 
        note="Everyone Qualifies" 
        amountDollars={499} 
        amountCents={39}
        signing={3.500}
        additionalInfo="| $0 Security Deposit"
      />
      <LeaseDealItem 
        note="Current Audi Owners" 
        amount={479}
        signing={3.500}
      />
    </div>
  )
}

function LeaseDealItem(props) {
  const note = props.note;
  const amountDollars = props.amountDollars;
  const amountCents = props.amountCents;
  const signing = props.signing;
  const additionalInfo = props.additionalInfo;
  return (
    <div>
      <Note 
        note={note} 
      />
      <Amount 
        amountDollars={amountDollars} 
        amountCents={amountCents} 
        signing={signing} 
      />
      <Signing 
        signing={signing} 
        additionalInfo={additionalInfo}
      />
    </div>
  )
}

function Note(props) {
  return (
    <p>{props.note}</p>
  )
}

function Amount(props) {
  return (
    <p>${props.amountDollars} {props.amountCents} Mo. Lease</p>
  )
}

function Signing(props) {
  return (
    <p>${props.signing.toFixed(3)} Due at Signing {props.additionalInfo}</p>
  )
}


function Description() {
  return (
    <p>
      MSRP: $47,450. 10K mi/yr. lease excludes tax, title, and plate free. For qualified customers though 
      Audi Financial Services. Vehicle image shown for ilustrative purposes only. #WC2776. Offer ends 09/03/19.
    </p>
  )
}
